.nuclide-nux-tooltip {
  z-index: 999;
}
.nuclide-nux-tooltip-helper-parent {
  position: relative;
}
.nuclide-nux-tooltip-helper {
  position: absolute;
  height: 100%;
  width: 100%;
  top: 0;
  left: 0;
}
.nuclide-nux-content-container {
  display: flex;
  flex-direction: column;
}
.nuclide-nux-navigation {
  align-self: flex-end;
  margin-top: 10px;
  color: #fff;
}
.nuclide-nux-link {
  border: 1px solid #fff;
  background-color: #4d78cc;
  border-radius: 3px;
  padding: 3px 8px 3px 8px;
  -webkit-user-select: none;
  /* Disable text selection, useful when double clicking */
  margin-left: 3px;
  font-size: 11px;
}
.nuclide-nux-link-enabled:hover {
  color: #4d78cc;
  background-color: #fff;
}
.nuclide-nux-link-enabled {
  cursor: pointer;
}
.nuclide-nux-link-disabled {
  cursor: not-allowed;
}
.nuclide-nux-link-disabled {
  border: 1px solid #fff;
  opacity: 0.6;
}
